from homework.print_function.print_function import print_function


class TestPrintFunction(object):
    def test_small_number(self):
        assert print_function(3) == "123"

    def test_medium_number(self):
        assert print_function(10) == "12345678910"

    def test_large_number(self):
        assert (
            print_function(133)
            == "123456789101112131415161718192021222324252627282930313233343536373839404142434445464748495051525354555657585960616263646566676869707172737475767778798081828384858687888990919293949596979899100101102103104105106107108109110111112113114115116117118119120121122123124125126127128129130131132133"
        )

    def test_edge_case_n_equals_1(self):
        assert print_function(1) == "1"

    def test_upper_limit(self):
        assert (
            print_function(150)
            == ""
        )
